        public static Texture2D CreateTextureFromBase64(string base64String)
        {
            byte[] bytes = Convert.FromBase64String(base64String);
            Texture2D tex = new Texture2D(512, 512);
            tex.LoadImage(bytes, false);
            tex.Apply();
            return tex;
        }
